import React from "react";
import "./App.css";
import Header from "./components/Header";
import HeroSection from "./components/HeroSection";
import ProjectShowcase from "./components/ProjectShowcase";
import Footer from "./components/Footer";

function App() {
  return (
    <div className="App">
      {/* Header */}
      <Header />

      {/* Hero Section */}
      <HeroSection />

      {/* About Section */}
      <section id="about" className="about-section container">
        <h2>About Us</h2>
        <p>
          We specialize in premium office interiors that boost productivity
          and employee satisfaction. Our designs combine modern aesthetics
          with functionality for every workspace.
        </p>
      </section>

      {/* Projects / Portfolio Section */}
      <section id="projects" className="projects container">
        <h2>Our Projects</h2>
        <ProjectShowcase />
      </section>

      {/* Walkthroughs Section */}
      <section id="walkthroughs" className="walkthroughs-section container">
        <h2>Walkthroughs</h2>
        <p>
          Explore virtual walkthroughs of our completed office projects and
          see how we transform spaces into inspiring workplaces.
        </p>
      </section>

      {/* Resources Section */}
      <section id="resources" className="resources-section container">
        <h2>Resources</h2>
        <p>
          Check out our guides, case studies, and articles for insights into
          modern office design trends and best practices.
        </p>
      </section>

      {/* Contact Section */}
      <section id="contact" className="contact-section container">
        <h2>Contact Us</h2>
        <p>Call us at +91 7683061117 or email us at info@officebanao.in</p>
      </section>

      {/* Footer */}
      <Footer />
    </div>
  );
}

export default App;
